- input: "TEXT\x1CC00012476\x1C.TEXT\x1C\x1CF3XA\x1CThis is to verify that no single
    contribution exceeded the $200 reporting threshold.  In addition this report was
    amended to correct the Independent Expenditure report filed on November 7, 2012.
    \ A 24/48 Notice of Independent Expenditure Schedule E was filed on November 7,
    2012, in connection with the design, production and printing of posters and bumper
    stickers with the words \"Union Plumbers & Fitters Obama Biden.  While these items
    were distributed only to the connected organization's affiliates and restricted
    class, given their nature, and in an abundance of caution, UAPEC determined that
    a Schedule E would be filed.   The reason why this report was filed after the
    election was because the vendor failed to send an estimated cost or invoice until
    after the election, and notwithstanding the best efforts of the Committee, the
    UAPEC's service provider responsible for filing the report was unable to connect
    the organization's receipt of the posters and bumper stickers from the vendor
    with the cost until after the election.  While the UAPEC timely filed several
    24/48 Notice of Independent Expenditure Schedule E reports during the 2012 election
    cycle, the UAPEC understands that the expenditures in question, would not have
    been filed on a timely basis, and it continues to strive to improve upon its reporting
    obligations. The material was distributed to affiliates over the course of September
    into October 2012.\n"
